def Slider2_eventhandler(event_struct):
   event = event_struct.code
   if event == lv.EVENT.VALUE_CHANGED and True:
      SetTextValueSlider( ui_Brightness_Percent, event_struct.get_target(), "", "%")
   return

def Volum_On_eventhandler(event_struct):
   event = event_struct.code
   if event == lv.EVENT.CLICKED and True:
      SetLabelProperty(ui_Brightness_Percent, 'Text', '100%')
   if event == lv.EVENT.CLICKED and True:
      SetSliderProperty(ui_Slider2, 'Value_with_anim', 100)
   return

def Volume_Off_eventhandler(event_struct):
   event = event_struct.code
   if event == lv.EVENT.CLICKED and True:
      SetLabelProperty(ui_Brightness_Percent, 'Text', '0%')
   if event == lv.EVENT.CLICKED and True:
      SetSliderProperty(ui_Slider2, 'Value_with_anim', 0)
   return

def BTN_Settings1_eventhandler(event_struct):
   event = event_struct.code
   if event == lv.EVENT.CLICKED and True:
      ChangeScreen( ui_Home, lv.SCR_LOAD_ANIM.FADE_ON, 100, 0)
   return

